import { Brand } from "./Brand";
import { Carbody } from "./Carbody";
import { EquipmentElement } from "./EquipmentElement";
import { Fuel } from "./Fuel";
import { TransmissionType } from "./TransmissionType";
import { VehicleImage } from "./VehicleImage";
import { YearOfProduction } from "./YearOfProduction";

export class Vehicle {
  vehicleId: number;

  brandId: number;
  brand: Brand;

  modelId: number;

  fuels: Fuel[] = [];

  carbodyId: number;
  carbody: Carbody;

  transmissionTypeId: number;
  transmissionType: TransmissionType;

  yearOfProductionId: number;
  yearOfProduction: YearOfProduction;

  vehicleImages: VehicleImage[] = [];
  equipment: EquipmentElement[] = [];

  mileage: string;

  constructor() {
    this.vehicleId = 0;
    this.brandId = 0;
    this.modelId = 0;
    this.carbodyId = 0;
    this.transmissionTypeId = 0;
    this.yearOfProductionId = 0;
    this.mileage = "";

    this.brand = new Brand();
    this.carbody = new Carbody();
    this.transmissionType = new TransmissionType();
    this.yearOfProduction = new YearOfProduction();
  }
}
